var cube = {
    // Define the six faces of the cube
    faces: "DLBURF",
    // This will contain a history of all the states to make sure we don't repeat a state
    states: [],
    // Which stickers are part of the same layer and should move along with the face
    edges: {
        D: [46, 45, 44, 38, 37, 36, 22, 21, 20, 14, 13, 12],
        L: [24, 31, 30, 40, 47, 46, 0, 7, 6, 20, 19, 18],
        B: [26, 25, 24, 8, 15, 14, 6, 5, 4, 36, 35, 34],
        U: [18, 17, 16, 34, 33, 32, 42, 41, 40, 10, 9, 8],
        R: [28, 27, 26, 16, 23, 22, 4, 3, 2, 44, 43, 42],
        F: [30, 29, 28, 32, 39, 38, 2, 1, 0, 12, 11, 10]
    },
    // Sets the cube to the solved state
    reset: function () {
        cube.states = ["yyyyyyyyoooooooobbbbbbbbwwwwwwwwrrrrrrrrgggggggg"];
    },
    // Twist the cube according to a move in WCA notation
    twist: function (state, move) {
        var i, k, prevState, face = move.charAt(0), faceIndex = cube.faces.indexOf(move.charAt(0)),
            turns = move.length > 1 ? (move.charAt(1) === "2" ? 2 : 3) : 1;
        state = state.split("");
        for (i = 0; i < turns; i++) {
            prevState = state.slice(0);
            // Rotate the stickers on the face itself
            for (k = 0; k < 8; k++) { state[(faceIndex * 8) + k] = prevState[(faceIndex * 8) + ((k + 6) % 8)]; }
            // Rotate the adjacent stickers that are part of the same layer
            for (k = 0; k < 12; k++) { state[cube.edges[face][k]] = prevState[cube.edges[face][(k + 9) % 12]]; }
        }
        return state.join("");
    },
    // Scramble the cube
    scramble: function () {
        var count = 0, total = 25, state, prevState = cube.states[cube.states.length - 1],
            move, moves = [], modifiers = ["", "'", "2"];
        while (count < total) {
            // Generate a random move
            move = cube.faces[Math.floor(Math.random() * 6)] + modifiers[Math.floor(Math.random() * 3)];
            // Don't move the same face twice in a row
            if (count > 0 && move.charAt(0) === moves[count - 1].charAt(0)) { continue; }
            // Avoid move sequences like "R L R", which is the same as "R2 L"
            if (count > 1 && move.charAt(0) === moves[count - 2].charAt(0) &&
                    moves[count - 1].charAt(0) === cube.faces.charAt((cube.faces.indexOf(move.charAt(0)) + 3) % 6)) {
                continue;
            }
            state = cube.twist(prevState, move);
            if (cube.states.indexOf(state) === -1) {
                // If this state hasn't yet been encountered, save it and move on
                moves[count] = move;
                cube.states[count] = state;
                count++;
                prevState = state;
            }
        }
        return moves;
    }
};

/*
 * Create the list of games in the header bar.
 */
function populateGames() {
    retrieveGames(function(games) {
        retrieveActiveGame(function(activeGame) {
            var gameList = $('#game-list');
            var template = gameList.find('.template'),
                clone,
                game;

            for(var i = 0; i < games.length; i++) {
                game = games[i];

                // 1. Clone template
                clone = template.clone();

                // 2. Update clone
                clone.removeClass('template').addClass('game-' + game);
                clone.find('a').text(game);
                clone.bind('click', handleActivateGame(game));

                if(game == activeGame) {
                    clone.addClass('active');
                }

                // 3. Add it to the game list
                gameList.append(clone);
            }

            populateActiveGame(activeGame);
        });
    });
}

function handleActivateGame(game) {
    return function() {
        storeActiveGame(game);
    };
}

function handleGameActivated(game) {
    config.activeGame = game;
    populateActiveGame(game);
    updateScores();
    scramble(game);
}

function populateActiveGame(game) {
    $('#game-list .active').removeClass('active');
    $('#game-list .game-' + game).addClass('active');
    $('#active-game .text').text(game);
    $('.panel-timer .panel-title > span').text(game);
}

function scramble(game) {
    console.log('scramble(game=%s)', game);
    if (Object.keys(config.scrambles).indexOf(game) > -1) {
        var i,
            scrambled = cube.scramble(),
            len = Math.min(config.scrambles[game].len, scrambled.length),
            result = "";
        for (i = 0; i < len; i += 5) {
            // Only allow a line break every 5 moves
            result += scrambled.slice(i, i + 5).join("&nbsp;") + " ";
        }
        $('#scramble').html(translate('scrambleLabel', [result]));
    } else {
        $('#scramble').html(translate('scrambleLabelNone'));
    }
}

function translate(key, params) {
    if(typeof(chrome) !== 'undefined' && typeof(chrome.i18n) !== 'undefined') {
        var translation = chrome.i18n.getMessage(key, params);
        if (translation) {
            return translation;
        }
    }

    return key;
}

function i18n() {
    if(typeof(chrome) === 'undefined' || typeof(chrome.i18n) === 'undefined') {
        return;
    }

    $("*[i18n-key]").each(function() {
        var that = $(this);
        that.html(translate(that.attr('i18n-key')));
    });
}

function migrate() {
    dao.get('databaseVersion', function(databaseVersion) {
        if(typeof(databaseVersion) === 'undefined') {
            databaseVersion = 0;
        }
        if(databaseVersion < 1) {
            // Migrate data set to support multiple games
            // 1. retrieve data
            dao.get('scores', function(scores) {
                // 2. remove data in scores
                dao.remove('scores');

                // 3. store data in game '3x3x3'
                dao.set('scores-3x3x3', scores);

                dao.set('databaseVersion', 1);
            });
        }
    });
}

function identity(v) {
    return v;
}

function addition(a, b) {
    return a + b;
}

function average(data, mapper) {
    if (typeof(mapper) === 'undefined') {
        mapper = identity;
    }

    var sum = data.map(mapper).reduce(addition, 0);

    return sum / data.length;
}

function median(data, mapper) {
    if (typeof(mapper) === 'undefined') {
        mapper = identity;
    }

    // map and sort the resulting array
    var m = data.map(mapper).sort(function(a, b) {
        return a - b;
    });

    var middle = Math.floor((m.length - 1) / 2);
    if (m.length % 2) {
        return m[middle];
    } else {
        return (m[middle] + m[middle + 1]) / 2.0;
    }
}

function standardDeviation(data, mapper) {
    if (typeof(mapper) === 'undefined') {
        mapper = identity;
    }

    var avg = average(data, mapper);

    var squareDiffs = data.map(mapper).map(function(value) {
        var diff = value - avg;
        var sqrDiff = diff * diff;
        return sqrDiff;
    });

    var avgSquareDiff = average(squareDiffs);

    return Math.sqrt(avgSquareDiff);
}

function movingAverage(data, size) {
    var avg = [];
    for (var i = 0; i < data.length; i++) {
        avg.push(average(data.slice(Math.max(i - size, 0), i+1)));
    }
    return avg;
}

function movingMinimum(data) {
    var minimum = [];
    for (var i = 0; i < data.length; i++) {
        minimum.push(Math.min(minimum.last(999999999), data[i]));
    }
    return minimum;
}

function createStats(scores) {
    var stats = {
        scores: scores,
        categories: {}
    };

    stats.values = scores.map(scoreValue);
    stats.last = stats.values.last();
    stats.last5 = stats.values.slice(-5).sort(compareNumbers);
    stats.last12 = stats.values.slice(-12).sort(compareNumbers);
    stats.best3of5 = stats.last5.slice(0, 3).sort(compareNumbers);
    stats.best10of12 = stats.last12.slice(0, 10).sort(compareNumbers);

    stats.values.sort(compareNumbers);

    stats.avg80 = stats.values.slice(
        0,
        Math.max(1, Math.floor(scores.length*0.8))
    );

    stats.values.forEach(function(value) {
        var category = valueToSub(value);
        if (!(category in stats.categories)) {
            stats.categories[category] = 0;
        }
        stats.categories[category]++;
    });

    return stats;
}

function updateCategories(stats) {
    var container = $('#subs'), e;
    container.find('.sub').remove();
    if(stats.scores[0].id !== 0) {
        Object
            .keys(stats.categories)
            .sort(compareNumbers)
            .slice(0, config.maxCategories)
            .forEach(function(category) {
                e = $('#subs .template').clone();
                e.removeClass('template');

                e.attr('id', 'subs-' + category)
                    .addClass('sub')
                    .find('.label')
                    .html('sub ' + category);
                e.find('.value').html(stats.categories[category]);
                container.append(e);
            });
    }
}

function updateStats() {
    console.log('Active game: ' + config.activeGame);
    retrieveScores(config.activeGame, function(scores) {
        if (scores.length < 1) {
            scores.push({id: 0, value: 0});
        }

        var stats = createStats(scores);

        updateChart(stats);
        updateCategories(stats);

        Object.keys(config.stats).forEach(function (stat) {
            updateStat(stat, config.stats[stat](stats));
        });
    });
}

function updateStat(key, value) {
    $('#stats-' + key + ' .value')
        .text(defaultFormatMilliseconds(value));
}

